import React from "react";
import Footer from "./Footer"

const HomePage = () => {
  return(
    <div className="page-container">
      <div className="content-wrap">
        <h1>Lets add some random text.</h1>
        <Footer />
      </div>
    </div>
  );
}

export default HomePage;
